import React from 'react';
import './Cards.css';

const Cards = ({ID}) => {
  if (ID.im==="fruit")
  return (
    <div className='card'>
      <div className='cardEllipse'>
        <img src={ID.im} alt='img.png' />
      </div>
      <div className='cardContent'>
        <h2>{ID.h2}</h2>
        <p>{ID.p}</p>
      </div>
    </div>
  );
};

export default Cards;
